const App = () => {
  const course = "Half Stack application development";
  const part1 = "Fundamentals of React";
  const exercices1 = 10;
  const part2 = "Using props to pass data";
  const exercices2 = 7;
  const part3 = "State ofs component";
  const exercices3 = 14;
  return (
    <>
      <Header course={course} />
      <Content part={part1} exercices={exercices1} />
      <Content part={part2} exercices={exercices2} />
      <Content part={part3} exercices={exercices3} />

      <p>Number of exercices {exercices1 + exercices2 + exercices3}</p>
    </>
  );
};
export default App;

const Header = (props) => {
  return (
    <>
      <h1>{props.course}</h1>
    </>
  );
};

const Content = (props) => {
  <>
    <p>
      {props.part} {props.exercices}
    </p>
  </>;
};
